import React from "react";
import skillsImage from "../assets/images/skills.svg";

const Skills = () => {
  return (
    <section
      id="skills"
      className="w-full max-md:mt-20 h-screen flex-col items-center justify-center"
    >
      <div className="w-full">
        <div className="flex items-center gap-2">
          <div className="text-white font-semibold text-3xl">
            <span className="text-[#0EE6B7]">#</span>
            skills
          </div>
          <div className="w-[260px] h-[2px] bg-pry-color"></div>
        </div>
        <br />
      </div>
      <div className="w-full flex">
        <div className="w-[50%] max-md:hidden">
          <img src={skillsImage} />
        </div>
        <div className="w-[50%] max-md:w-full"></div>
      </div>
    </section>
  );
};

export default Skills;
